import Post from "./Post";

const HomePage = () => {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("http://localhost:4000/post");
      setPosts(response.json());
    };
  });

  return (
    <div>
      <Post />
      <Post />
      <Post />
    </div>
  );
};

export default HomePage;
